import React, { useEffect, useState } from 'react';
import axios from 'axios';

function YourComponent() {
  const [sessionData, setSessionData] = useState(null);

  useEffect(() => {
    // Send a GET request to retrieve session data from the backend
    axios.get('http://localhost:8000/api/usession', { withCredentials: true })
      .then(response => {
        // Handle the session data received from the backend
        setSessionData(response.data.message);
      })
      .catch(error => {
        console.error(error);
      });
  }, []);

  return (
    <div>
      <h1>Your Component</h1>
      {sessionData ? (
        <p>Session Data: {JSON.stringify(sessionData)}</p>
      ) : (
        <p>Loading session data...</p>
      )}
    </div>
  );
}

export default YourComponent;
